  \"A Flight-like Integrated Circulator for Broad Area Cooling Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:09:51.126157\",\n\t\"name\": \"a-flight-like-integrated-circulator-for-broad-area-cooling-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Future instruments and platforms for NASA
  space applications will require increasingly sophisticated thermal control technology,
  and cryogenic applications will become increasingly more common. For example, the
  Single Aperture Far-IR (SAFIR) telescope and other cryogenic telescope missions
  must provide distributed cooling and multiple heat lift. Also, the management of
  cryogenic propellants requires distributed cooling through integrated heat exchangers
  for zero boil-off, densification and cooling of structural members. To address these
  requirements, we propose to develop a lightweight, continuous-flow cooling loop
  that can provide cooling and temperature control to multiple, distributed and broad
  area loads. This approach allows relatively simple mechanical and electrical integration
  and maintains high refrigeration system efficiency. The basis of the loop is a set
  of cold check valves that converts the oscillating pressure, which characterizes
  the operation of regenerative cryocoolers, into a quasi-steady pressure difference
  that can be used to drive a continuous flow of cold gas over distances of several
  meters. This Integrated Circulator (IC) has the potential secondary benefit of rapid
  and therefore precise load temperature regulation of multiple sensors or structures
  using actively controlled throttle valves to regulate the local gas flow.\",\n\t\"license_title\":
